  _handleValue:function(v){
    if (v=="'null'") {
      return "null";
    }else if (v=="null") {
      return null;
    }else if (v=="''") {
      return ""
    }else if (v=="\\'\\'") {
      return "''";
    }else if (v=="\\\\'\\\\'") {
      return "\\'\\'";
    }else{
      var ws=v.split(this._WS_REGEXP);
      var ms=v.split(this._MS_REGEXP);
      v="";
      for(var i=0;i<ws.length;i++){
        ws[i]=this._getOldWord(ws[i]);
      }
      var s1=ws;
      var s2=ms;
      
      if (s2.length>s1.length) {
        s1=ms;
        s2=ws;
      }else if (s2.length==s1.length && !s2[0]) {
        s1=ms;
        s2=ws;
      }
      
      for(var i=0;i<s1.length;i++){
        v+=s1[i];
        if (s2.length>i) {
          v+=s2[i];
        }
      }

      if (v[0]=="'") {
        try{
          var w="";
          eval("w="+v);
          v=w;
        }catch(e){}
      }else if (parseFloat(v)+""==v) {
        return parseFloat(v);
      }else if (v=="true") {
        return true;
      }else if (v=="false") {
        return false;
      }else if(Date.parse(v)){
        if(JSON.stringify(new Date(v)).indexOf(v)>=0){
          return new Date(v);
        }
      }
    }
    v=_compressJSON._unConvert(v);
    return v;
  },
