  _getSlider:function(_if,ds,_css){
    let _silderData=_CtrlDriver._buildProxy({_list:[]})
    ds.forEach(x=>{
      _silderData._list.push({
        _rate:1/ds.length
      })
    })
    return {
      _if:function(){
        return _if?_if(_silderData):1
      },
      _tag:"div",
      _attr:{
        class:"bz-slider-area",
      },
      _after:function(o){
        if(_css){
          $(o).css(_css)
        }
        setTimeout(()=>{
          o=o.getBoundingClientRect().width
          _silderData._list.forEach(x=>{
            x._flex=parseInt(x._rate*o)
          })
        },10)
      },
      _items:[
        {
          _tag:"div",
          _attr:{
            class:"bz-slider-box",
            style:function(d){
              let _itemIf=d._item._if,r
              if(_itemIf){
                if(_itemIf.constructor==Function){
                  r=_itemIf()
                }else{
                  r=eval(_itemIf)
                }
                if(!r){
                  if(d._idx){
                    _silderData._list[0]._hide=0
                  }
                  return "display:none"
                }
              }
              d=_silderData._list[d._idx]
              d=d._flex||d._rate
              if(d<1){
                d=1
              }
              return "display:flex;flex:"+d
            }
          },
          _items:[
            {
              _if:"_data._idx",
              _tag:"div",
              _after:function(o,d){
                let _start,_end
                _Util._setDrag([o],o,0,function(x,y){
                  let o1=_silderData._list[d._idx],
                      o2=_silderData._list[d._idx-1]
                      
                  if(x===undefined){
                    let w1=o.parentElement.getBoundingClientRect().width
                    let w2=o.parentElement.previousSibling.getBoundingClientRect().width

                    o1._flex=w1
                    o2._flex=w2
                    o1._rate=w1/(w1+w2)*_start.r
                    o2._rate=_start.r-o1._rate

                    _start=0
                    $(o.nextSibling).css({"margin-left":0})
                    $(o).css({position:"flex"})
                  }else if(!_start){
                    _start={
                      x:x,
                      w1:o1._flex,
                      w2:o2._flex,
                      r:o1._rate+o2._rate,
                      w:o1._flex+o2._flex
                    }
                  }else{
                    o1._flex=_start.w1+_start.x-x
                    o1._rate=o1._flex/_start.w*_start.r

                    o2._flex=_start.w-o1._flex
                    o2._rate=_start.r-o1._rate
                    
                    if(o1._flex<100){
                      o2._flex=_start.w
                      o2._rate=_start.r
                      o1._flex=1
                      o1._rate=0
                      o1._hide=1
                    }else if(o2._flex<100){
                      o1._flex=_start.w
                      o1._rate=_start.r
                      o2._flex=1
                      o2._rate=0
                      o2._hide=1
                    }else{
                      o1._hide=0
                      o2._hide=0
                    }
                  }
                  return 1
                })
              },
              _attr:{
                class:"bz-slider-bar"
              },
              _jqext:{
                mouseover:function(){
                  $(this).css({height:this.parentElement.getBoundingClientRect().height+"px",left:"unset"})
                },
                mousedown:function(){
                  $(this).css({position:"absolute"})
                  $(this.nextSibling).css({"margin-left":"5px"})
                },
                mouseout:function(){
                  $(this).css({height:"100%"})
                }
              },
              _items:[
                {
                  _if:function(d){
                    return _silderData._list[d._idx-1]._rate
                  },
                  _tag:"button",
                  _attr:{
                    class:"btn btn-icon bz-small-btn bz-back-white",
                  },
                  _jqext:{
                    click:function(){
                      _switchContent(this._data._idx-1,this._data._idx)
                    }
                  }
                },
                {
                  _if:function(d){
                    return _silderData._list[d._idx]._rate
                  },
                  _tag:"button",
                  _attr:{
                    class:"btn btn-icon bz-small-btn bz-back-white",
                    style:"transform:rotate(180deg)"
                  },
                  _jqext:{
                    click:function(){
                      _switchContent(this._data._idx,this._data._idx-1)
                    }
                  }
                }
              ]
            },
            {
              _if:function(d){
                return !_silderData._list[d._idx]._hide
              },
              _tag:"div",
              _attr:{
                class:"'bz-slider-content bz-slider-content-'+_data._idx"
              },
              _items:function(d){
                return [d._item]
              }
            }
          ],
          _dataRepeat:ds
        }
      ]
    }
    
    function _switchContent(_close,_open){
      let o1=_silderData._list[_close]
      let o2=_silderData._list[_open]
      if(o2._rate){
        o2._rate+=o1._rate
        o2._flex+=o1._flex
        o1._rate=0
        o1._hide=1
        o2._hide=0
        o1._flex=1
      }else{
        o2._rate=o1._rate/2
        o2._flex=o1._flex/2
        o1._rate/=2
        o1._hide=0
        o2._hide=0
        o1._flex/=2
      }
    }
  },
