    function _formatValue(v){
      return (v+"").replace(/[- ]/g,"_")
    }
    function _parseData(v,_type,_url){
      try{
        if(_type=="csv"){
          v=_ideDataHandler._parseCSV(v) 
          var s="",vs=[];
          v[0].forEach((vv,i)=>{
            vv=_formatValue(vv)
            v[0][i]=vv
          })
          if(v[0][0]=="_"+"key"){
            vs={}
            _type="m"
          }
          for(var i=1;i<v.length;i++){
            var vv=v[i];
            let o={},kk;
            v[0].forEach((k,n)=>{
              if(_type=="m"){
                if(!n){
                  kk=_formatValue(v[i][0])
                  return
                }
              }
              o[k]=v[i][n]
            })
            if(_type=="m"){
              vs[kk]=o
            }else{
              vs.push(o)
            }
          }
          v=vs
        }else{
          eval("v="+v);
        }
        _ideDataHandler._urlDataMap[_url]=v;
        return v;
      }catch(e){
        alert(_Util._formatMessage(_bzMessage._dataBind._loadDataFailed+_getErrDataFrom(),[_url,v]));
      }
    }
