  _buildViewData:function(_flow){
    let _root={k:"start",c:0,id:"f-0",to:[]},r,_idx=1;
    let _list=[[_root]],gs=[],_max={v:1,r:0}
    
    _buildLevelGroup(_flow.start,gs,_root)
    
    while(gs.length){
      if(gs.length>_max.v){
        _max.r=_list.length
        _max.v=gs.length
      }

      _list.push(gs)
      let ns=gs,_remove=[]
      gs=[]
      ns.forEach(x=>{
        if(!_flow[x.k]){
          _remove.push(x)
          return
        }
        if(!_chkLoop(x,x.k)){
          _buildLevelGroup(_flow[x.k],gs,x)
        }
      })
      _Util._spliceAll(ns,x=>{
        return _remove.includes(x)
      })
    }

    for(let i=_max.r-1;i>=0;i--){
      r=_list[i]
      r.forEach(x=>{
        let v=0
        x.to.forEach(x=>{
          v+=x.c
        })
        if(x.to.length){
          x.c=v/x.to.length
        }
      })
      r.sort((a,b)=>{
        return a.c-b.c
      })
      let j=0,_rmin=0,_rmax;
      while(j<r.length){
        let cs=_getCloserGroup(r,j)
        if(cs.cs.length>1){
          if(r[cs.i]){
            _rmax=r[cs.i].c
          }else{
            _rmax=_max.v
          }
          _space=0
          if(_rmax-_rmin>cs.cs.length){
            _space=(_rmax-_rmin-cs.cs.length)/2
          }
          let n=0
          for(;j<cs.i;j++){
            if(r[j].c>_space+n){
              r[j].c=_space+n
              
            }
            if(j&&r[j].c<r[j-1].c+1){
              r[j].c=r[j-1].c+1
            }
            n++
          }
          _rmin=r[j-1].c+1
        }else{
          if(j&&r[j].c<r[j-1].c+1){
            r[j].c=r[j-1].c+1
          }
          _rmin=r[j++].c+1
        }
      }
    }

    for(let i=_max.r+1;i<_list.length;i++){
      r=_list[i]
      r.forEach(x=>{
        let v=0
        x.fs.forEach(x=>{
          v+=x.c
        })
        if(x.fs.length){
          x.c=v/x.fs.length
        }
      })
      r.sort((a,b)=>{
        return a.c-b.c
      })
      let j=0,_rmin=0,_rmax;
      while(j<r.length){
        let cs=_getCloserGroup(r,j)
        if(cs.cs.length>1){
          if(r[cs.i]){
            _rmax=r[cs.i].c
          }else{
            _rmax=_max.v
          }
          _space=0
          if(_rmax-_rmin>cs.cs.length){
            _space=(_rmax-_rmin-cs.cs.length)/2
          }
          let n=0
          for(;j<cs.i;j++){
            if(r[j].c>_space+n){
              r[j].c=_space+n
            }
            if(j&&r[j].c<r[j-1].c+1){
              r[j].c=r[j-1].c+1
            }
            n++
          }
          _rmin=r[j-1].c+1
        }else{
          if(j&&r[j].c<r[j-1].c+1){
            r[j].c=r[j-1].c+1
          }
          _rmin=r[j++].c+1
        }
      }
    }
    
    return _list
    function _getCloserGroup(vs,i){
      let o=vs[i],cs=[i]
      for(i=i+1;i<vs.length;i++){
        let oo=vs[i]
        if(oo.c-o.c<1){
          cs.push(i)
          o=oo
        }else{
          break
        }
      }
      return {cs:cs,i:i}
    }
    function _chkLoop(v,k){
      if(v.fs){
        return v.fs.find(f=>{
          return f.k==k||_chkLoop(f,k)
        })
      }
    }
    
    function _buildLevelGroup(vs,gs,f){
      if(vs.to){
        let ks=Object.keys(vs.to).forEach(x=>{
          let g=gs.find(y=>{
            return y.k==x
          })
          if(g){
            g.fs.push(f)
          }else{
            g={
              id:"f-"+_idx++,
              fs:[f],
              k:x,
              to:[],
              c:gs.length,
            }
            gs.push(g)
          }
          
          f.to.push(g)
        })
      }
    }
  },
  _getGUIDataList:function(_list){
    let _guiList=[],h=100,w=160
    _list.forEach((r,ri)=>{
      let _left=50
      r.forEach((x,xi)=>{
        if(x.fs){
          x.fs.forEach(f=>{
            _guiList.push({
              f:f.id,
              t:x.id,
            })
          })
        }
        x.x=_left+x.c*w
      })
    })
    return _guiList
  },
