    return (v||"").replace(/([\/]|^)[sfew]($|[\/])/g,"/")
            .replace(/([\/]|^)[\.]+($|[\/])/g,"/")
            .replace(/([\/]|^)[0-9]+($|[\/])/g,"/")
            .replace(/[\/]+/,"")
